{"post_stream":{"posts":[{"id":2990351,"name":"Abe P","username":"apanteli23","avatar_template":"/letter_avatar_proxy/v4/letter/a/50afbb/{size}.png","created_at":"2022-01-12T23:53:37.308Z","cooked":"<p>I’ve updated WPILib to version 2022.1.1 and FRC Driver Station 22.0. RoboRio image is FRC_roboRio_2022_v3.0.<br>
After deploying code to rio, the we get an error message in the rioLog.<br>
Error: Could not find or load main class frc.robot.Main<br>
Caused by: java.lang.ClassNotFoundException: frc.robot.Main<br>
I’ve recreated the project multiple times using the WPI create a new project feature but the same message every time. There are no other errors in the code.<br>
Main project looks like this</p>
<pre><code>package frc.robot;
import edu.wpi.first.wpilibj.RobotBase;
public final class Main {
  private Main() {}
  public static void main(String... args) {
    RobotBase.startRobot(Robot::new);
  }
}</code></pre>","post_number":1,"post_type":1,"posts_count":3,"updated_at":"2022-01-12T23:53:37.308Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":130,"reads":60,"readers_count":59,"score":662.0,"yours":false,"topic_id":399974,"topic_slug":"issue-with-2022-frc-driver-station-and-wpilib-error-error-could-not-find-or-load-main-class-frc-robot-main","display_username":"Abe P","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":42732,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"Student Programmer Team 3467"},"post_url":"/t/issue-with-2022-frc-driver-station-and-wpilib-error-error-could-not-find-or-load-main-class-frc-robot-main/399974/1","custom_user_title":"Student Programmer Team 3467","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null,"can_vote":false},{"id":2990374,"name":"Abe P","username":"apanteli23","avatar_template":"/letter_avatar_proxy/v4/letter/a/50afbb/{size}.png","created_at":"2022-01-13T00:20:12.776Z","cooked":"<p>Update there was a new url for the ctre website that may have been causing the issue<br>
